import { useState } from "react";


const Form = ()=>{

    const [form, setForm] = useState({
        Nombre:"",
        Imagen:"",
        Vida:"",
        Ataque:"",
        Defensa:"",
        Velocidad:"",
        Altura:"",
        Peso:"",
        tipo:[]
        
    })
    return(
        <form>
            <div>Nombre</div>

            <div>Imagen</div>

            <div>Vida</div>

            <div>Ataque</div>

            <div>Defensa</div>

            <div>Nombre</div>

            <div>Nombre</div>
            
        </form>
    )
}

export default Form;
